import "./Character.css";
import characters from '../db/Character/Character';



function Character() {

  return (
    <>
     <div className="navbar_logo">
        <h2>BREAKINGBAD SOFTWARE</h2>
    </div>
    
      <ul>
     
        {characters.map((i) => 
        <List />)}
      </ul>
    </>
  );
}

function List(props) {
  return <div>{props}</div>;
}
export default Character;
